public class InnerKnowledgeBaseStorageConfigurationFactory(Action<Humidifier.Bedrock.KnowledgeBaseTypes.StorageConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.Bedrock.KnowledgeBaseTypes.StorageConfiguration>
{

    internal InnerKnowledgeBaseOpenSearchServerlessConfigurationFactory OpensearchServerlessConfigurationFactory { get; set; }

    internal InnerKnowledgeBaseMongoDbAtlasConfigurationFactory MongoDbAtlasConfigurationFactory { get; set; }

    internal InnerKnowledgeBaseRdsConfigurationFactory RdsConfigurationFactory { get; set; }

    internal InnerKnowledgeBasePineconeConfigurationFactory PineconeConfigurationFactory { get; set; }

    protected override Humidifier.Bedrock.KnowledgeBaseTypes.StorageConfiguration Create()
    {
        var storageConfigurationResult = CreateStorageConfiguration();
        factoryAction?.Invoke(storageConfigurationResult);

        return storageConfigurationResult;
    }

    private Humidifier.Bedrock.KnowledgeBaseTypes.StorageConfiguration CreateStorageConfiguration()
    {
        var storageConfigurationResult = new Humidifier.Bedrock.KnowledgeBaseTypes.StorageConfiguration();

        return storageConfigurationResult;
    }
    public override void CreateChildren(Humidifier.Bedrock.KnowledgeBaseTypes.StorageConfiguration result)
    {
        base.CreateChildren(result);

        result.OpensearchServerlessConfiguration ??= OpensearchServerlessConfigurationFactory?.Build();
        result.MongoDbAtlasConfiguration ??= MongoDbAtlasConfigurationFactory?.Build();
        result.RdsConfiguration ??= RdsConfigurationFactory?.Build();
        result.PineconeConfiguration ??= PineconeConfigurationFactory?.Build();
    }

} // End Of Class

